import React from 'react';
import './style.css';

export default function Nav() {
    return (
        <div className='navbar-items'>
            <p className='home'>Home</p>
            <p className='about'>About</p>
            <p className='works'>Works</p>
            <p className='contact'>Contact</p>
        </div>
    )
}



